export default function About() {
  return (
    <div id="about-wrapper">
      <h3 id="about">About</h3>
      <p id="about-text">
        Go-Getter prepared to generate productivity and excellence for any team
        that gives the opportunity. Over a decade of general work experience
        with 4 years of self-employment.
      </p>
    </div>
  );
}
